let insProf = 'INSERT INTO professor (id_campus,nome_professor,email_professor,lattes_professor) VALUES'
let insRia  = 'INSERT INTO ria(link_ria,id_professor) VALUES'
let insPtd = 'INSERT INTO ptd(link_ptd,id_professor) VALUES'
let insHorario = 'INSERT INTO horario(link_horario,id_professor) VALUES'
let idProf=0
for(let i=0;i<data.length;i++){
    data[i].forEach(professor=>{
        idProf++
        insProf+=`\n(${i+1},"${professor.nome}",'${professor.email}','${professor.lattes}'),`
        if(professor.ria.length>0)
            insRia+=`\n('${professor.ria}',${idProf}),`
        if(professor.ptd.length>0)
            insPtd+=`\n('${professor.ptd}',${idProf}),`
        if(professor.horario.length>0)
            insHorario+=`\n('${professor.horario}',${idProf}),`
    })
}
insProf = insProf.substring(0,insProf.length-1) +';'
insRia = insRia.substring(0,insRia.length-1) +';'
insPtd = insPtd.substring(0,insPtd.length-1) +';'
insHorario = insHorario.substring(0,insHorario.length-1) +';'
copy(insProf+"\n"+insRia+"\n"+insPtd+"\n"+insHorario)